INSERT INTO "base_formpage" VALUES (21,'saiherng14@gmail.com','info@cityschoolmm.com','Contact Us Inquiries from Cityschoolmm.com','<p data-block-key="u1icm">Thank you for sending us your queries. We will respond shortly</p>','<h3 data-block-key="ztqti">Please send us your inquiries and we will respond shortly.</h3><p data-block-key="fjrod"><b>Teacher duties and responsibilities</b></p><p data-block-key="d85oo">The duties and responsibilities of Teachers vary depending on the age and abilities of their students. Primary School Teachers typically have a heavier focus on social and formative skills, while Secondary and Postsecondary School Teachers focus on selecting and developing skills for specific career paths. Examples of their common duties and responsibilities include:</p><ul><li data-block-key="c6sa1">Establishing and enforcing rules of behavior for students in the classroom</li><li data-block-key="7epf2">Preparing lessons, units and projects to complete learning objectives</li><li data-block-key="rd9r">Establishing and communicating clear objectives for lessons, units and projects</li><li data-block-key="aanm7">Adapting teaching methods and materials to meet the interests and learning styles of students</li><li data-block-key="50kll">Encouraging students to explore learning opportunities and career paths</li><li data-block-key="4h1qn">Creating, assigning and grading various assessments for students, including tests, quizzes, essays and projects</li><li data-block-key="266tq">Working with students one-on-one when they need extra help or attention</li><li data-block-key="7phcm">Tracking and evaluating student academic progress</li><li data-block-key="fld41">Leading parent-teacher meetings</li><li data-block-key="eokcg">Maintaining positive relationships with students, parents, coworkers and supervisors</li><li data-block-key="bmomr">Managing student behavior</li><li data-block-key="6elbg">Creating a safe, respectful and inclusive classroom environment</li><li data-block-key="94e9k">Communicating regularly with parents</li><li data-block-key="bq6p2">Helping students improve study methods and habits</li><li data-block-key="28r74">Administering tests to evaluate students’ progress</li></ul>','[]');
