INSERT INTO "blog_blogpage" VALUES (26,'2024-08-16','City School Yangon guarantees a bright future for your children''s education.','[{"type": "base", "value": [{"type": "paragraph_block", "value": "<p data-block-key=\"6oknh\">\ud835\udc16\ud835\udc21\ud835\udc32 \ud835\udc12\ud835\udc21\ud835\udc28\ud835\udc2e\ud835\udc25\ud835\udc1d \ud835\udc18\ud835\udc28\ud835\udc2e \ud835\udc02\ud835\udc21\ud835\udc28\ud835\udc28\ud835\udc2c\ud835\udc1e \ud835\udc02\ud835\udc22\ud835\udc2d\ud835\udc32 \ud835\udc12\ud835\udc1c\ud835\udc21\ud835\udc28\ud835\udc28\ud835\udc25 \ud835\udc18\ud835\udc1a\ud835\udc27\ud835\udc20\ud835\udc28\ud835\udc27?</p><p data-block-key=\"blpn6\"> \ud835\udc02\ud835\udc22\ud835\udc2d\ud835\udc32 \ud835\udc12\ud835\udc1c\ud835\udc21\ud835\udc28\ud835\udc28\ud835\udc25 \ud835\udc18\ud835\udc1a\ud835\udc27\ud835\udc20\ud835\udc28\ud835\udc27 \ud835\udc20\ud835\udc2e\ud835\udc1a\ud835\udc2b\ud835\udc1a\ud835\udc27\ud835\udc2d\ud835\udc1e\ud835\udc1e\ud835\udc2c \ud835\udc1a \ud835\udc1b\ud835\udc2b\ud835\udc22\ud835\udc20\ud835\udc21\ud835\udc2d \ud835\udc1f\ud835\udc2e\ud835\udc2d\ud835\udc2e\ud835\udc2b\ud835\udc1e \ud835\udc1f\ud835\udc28\ud835\udc2b \ud835\udc32\ud835\udc28\ud835\udc2e\ud835\udc2b \ud835\udc1c\ud835\udc21\ud835\udc22\ud835\udc25\ud835\udc1d''\ud835\udc2c \ud835\udc1e\ud835\udc1d\ud835\udc2e\ud835\udc1c\ud835\udc1a\ud835\udc2d\ud835\udc22\ud835\udc28\ud835\udc27.</p><p data-block-key=\"1gsbt\"> Situated in \ud835\udc13\ud835\udc22\ud835\udc26\ud835\udc1e\ud835\udc2c \ud835\udc02\ud835\udc22\ud835\udc2d\ud835\udc32, a prime area in Yangon, the school offers not only convenience in transportation but also a safe and secure neighborhood.</p><p data-block-key=\"cllp0\">To ensure that students remain healthy and happy throughout the academic year, City School Yangon provides:</p><p data-block-key=\"agii6\"> \ud835\udc01\ud835\udc22\ud835\udc1a\ud835\udc27\ud835\udc27\ud835\udc2e\ud835\udc1a\ud835\udc25 \ud835\udc21\ud835\udc1e\ud835\udc1a\ud835\udc25\ud835\udc2d\ud835\udc21 \ud835\udc1c\ud835\udc21\ud835\udc1e\ud835\udc1c\ud835\udc24-\ud835\udc2e\ud835\udc29\ud835\udc2c</p><p data-block-key=\"alvgn\">\ud835\udc0c\ud835\udc28\ud835\udc27\ud835\udc2d\ud835\udc21\ud835\udc25\ud835\udc32 \ud835\udc26\ud835\udc1e\ud835\udc1a\ud835\udc25 \ud835\udc29\ud835\udc25\ud835\udc1a\ud835\udc27\ud835\udc2c</p><p data-block-key=\"c7jt5\">\ud835\udc11\ud835\udc1e\ud835\udc25\ud835\udc22\ud835\udc1a\ud835\udc1b\ud835\udc25\ud835\udc1e \ud835\udc2c\ud835\udc1c\ud835\udc21\ud835\udc28\ud835\udc28\ud835\udc25 \ud835\udc1f\ud835\udc1e\ud835\udc2b\ud835\udc2b\ud835\udc32 \ud835\udc2c\ud835\udc1e\ud835\udc2b\ud835\udc2f\ud835\udc22\ud835\udc1c\ud835\udc1e\ud835\udc2c</p><p data-block-key=\"8u2d9\">These amenities allow busy parents to confidently entrust their children to the school. </p><p data-block-key=\"6rdc6\">Moreover, the school follows the internationally recognized \ud835\udc02\ud835\udc1a\ud835\udc26\ud835\udc1b\ud835\udc2b\ud835\udc22\ud835\udc1d\ud835\udc20\ud835\udc1e \ud835\udc02\ud835\udc2e\ud835\udc2b\ud835\udc2b\ud835\udc22\ud835\udc1c\ud835\udc2e\ud835\udc25\ud835\udc2e\ud835\udc26, ensuring structured learning.</p><p data-block-key=\"9euv\"> Additionally, it incorporates \ud835\udc29\ud835\udc25\ud835\udc1a\ud835\udc32-\ud835\udc1b\ud835\udc1a\ud835\udc2c\ud835\udc1e\ud835\udc1d \ud835\udc25\ud835\udc1e\ud835\udc1a\ud835\udc2b\ud835\udc27\ud835\udc22\ud835\udc27\ud835\udc20 and offers various \ud835\udc1e\ud835\udc31\ud835\udc2d\ud835\udc2b\ud835\udc1a\ud835\udc1c\ud835\udc2e\ud835\udc2b\ud835\udc2b\ud835\udc22\ud835\udc1c\ud835\udc2e\ud835\udc25\ud835\udc1a\ud835\udc2b \ud835\udc1a\ud835\udc1c\ud835\udc2d\ud835\udc22\ud835\udc2f\ud835\udc22\ud835\udc2d\ud835\udc22\ud835\udc1e\ud835\udc2c to make learning enjoyable.</p><p data-block-key=\"ak1bp\">\ud835\udc02\ud835\udc22\ud835\udc2d\ud835\udc32 \ud835\udc12\ud835\udc1c\ud835\udc21\ud835\udc28\ud835\udc28\ud835\udc25 \ud835\udc18\ud835\udc1a\ud835\udc27\ud835\udc20\ud835\udc28\ud835\udc27 also provides \ud835\udc1c\ud835\udc28\ud835\udc26\ud835\udc29\ud835\udc25\ud835\udc22\ud835\udc26\ud835\udc1e\ud835\udc27\ud835\udc2d\ud835\udc1a\ud835\udc2b\ud835\udc32 \ud835\udc1c\ud835\udc25\ud835\udc1a\ud835\udc2c\ud835\udc2c\ud835\udc1e\ud835\udc2c for students to \ud835\udc1e\ud835\udc31\ud835\udc29\ud835\udc25\ud835\udc28\ud835\udc2b\ud835\udc1e \ud835\udc2d\ud835\udc21\ud835\udc1e\ud835\udc22\ud835\udc2b \ud835\udc22\ud835\udc27\ud835\udc2d\ud835\udc1e\ud835\udc2b\ud835\udc1e\ud835\udc2c\ud835\udc2d\ud835\udc2c in sports or music.</p><p data-block-key=\"93b44\">\ud835\udc11\ud835\udc1e\ud835\udc20\ud835\udc2e\ud835\udc25\ud835\udc1a\ud835\udc2b \ud835\udc1d\ud835\udc22\ud835\udc2c\ud835\udc1c\ud835\udc2e\ud835\udc2c\ud835\udc2c\ud835\udc22\ud835\udc28\ud835\udc27\ud835\udc2c \ud835\udc30\ud835\udc22\ud835\udc2d\ud835\udc21 \ud835\udc29\ud835\udc1a\ud835\udc2b\ud835\udc1e\ud835\udc27\ud835\udc2d\ud835\udc2c help identify and address each \ud835\udc2c\ud835\udc2d\ud835\udc2e\ud835\udc1d\ud835\udc1e\ud835\udc27\ud835\udc2d''\ud835\udc2c \ud835\udc2c\ud835\udc2d\ud835\udc2b\ud835\udc1e\ud835\udc27\ud835\udc20\ud835\udc2d\ud835\udc21\ud835\udc2c \ud835\udc1a\ud835\udc27\ud835\udc1d \ud835\udc30\ud835\udc1e\ud835\udc1a\ud835\udc24\ud835\udc27\ud835\udc1e\ud835\udc2c\ud835\udc2c\ud835\udc1e\ud835\udc2c.</p><p data-block-key=\"8lckj\"> For the safety of children, \ud835\udc1e\ud835\udc2f\ud835\udc1e\ud835\udc2b\ud835\udc32 \ud835\udc2b\ud835\udc28\ud835\udc28\ud835\udc26 \ud835\udc22\ud835\udc2c \ud835\udc1e\ud835\udc2a\ud835\udc2e\ud835\udc22\ud835\udc29\ud835\udc29\ud835\udc1e\ud835\udc1d \ud835\udc30\ud835\udc22\ud835\udc2d\ud835\udc21 \ud835\udc02\ud835\udc02\ud835\udc13\ud835\udc15, \ud835\udc1a\ud835\udc27\ud835\udc1d \ud835\udc1a\ud835\udc2c\ud835\udc2c\ud835\udc22\ud835\udc2c\ud835\udc2d\ud835\udc1a\ud835\udc27\ud835\udc2d \ud835\udc2d\ud835\udc1e\ud835\udc1a\ud835\udc1c\ud835\udc21\ud835\udc1e\ud835\udc2b\ud835\udc2c are available to provide close supervision.</p><p data-block-key=\"5cdp2\">If you seek \ud835\udc1a \ud835\udc1c\ud835\udc28\ud835\udc26\ud835\udc29\ud835\udc2b\ud835\udc1e\ud835\udc21\ud835\udc1e\ud835\udc27\ud835\udc2c\ud835\udc22\ud835\udc2f\ud835\udc1e \ud835\udc1e\ud835\udc1d\ud835\udc2e\ud835\udc1c\ud835\udc1a\ud835\udc2d\ud835\udc22\ud835\udc28\ud835\udc27\ud835\udc1a\ud835\udc25 \ud835\udc1e\ud835\udc27\ud835\udc2f\ud835\udc22\ud835\udc2b\ud835\udc28\ud835\udc27\ud835\udc26\ud835\udc1e\ud835\udc27\ud835\udc2d \ud835\udc1f\ud835\udc28\ud835\udc2b \ud835\udc32\ud835\udc28\ud835\udc2e\ud835\udc2b \ud835\udc1c\ud835\udc21\ud835\udc22\ud835\udc25\ud835\udc1d''\ud835\udc2c \ud835\udc1d\ud835\udc1e\ud835\udc2f\ud835\udc1e\ud835\udc25\ud835\udc28\ud835\udc29\ud835\udc26\ud835\udc1e\ud835\udc27\ud835\udc2d, come to \ud835\udc02\ud835\udc22\ud835\udc2d\ud835\udc32 \ud835\udc12\ud835\udc1c\ud835\udc21\ud835\udc28\ud835\udc28\ud835\udc25 \ud835\udc18\ud835\udc1a\ud835\udc27\ud835\udc20\ud835\udc28\ud835\udc27 today.</p><p data-block-key=\"65jer\">For more details,</p><p data-block-key=\"5t4e4\"> \ud835\udc02\ud835\udc28\ud835\udc27\ud835\udc2d\ud835\udc1a\ud835\udc1c\ud835\udc2d - \ud835\udfce\ud835\udfd7 \ud835\udfd5\ud835\udfd6\ud835\udfd4 \ud835\udfce\ud835\udfd0\ud835\udfd7 \ud835\udfd3\ud835\udfd6\ud835\udfd3, \ud835\udfce\ud835\udfd7 \ud835\udfd5\ud835\udfd6\ud835\udfd4 \ud835\udfce\ud835\udfd0\ud835\udfd7 \ud835\udfd3\ud835\udfd6\ud835\udfd4</p><p data-block-key=\"4f7vu\">\ud835\udc0b\ud835\udc28\ud835\udc1c\ud835\udc1a\ud835\udc2d\ud835\udc22\ud835\udc28\ud835\udc27 - \ud835\udfd5\ud835\udc2d\ud835\udc21 \ud835\udc05\ud835\udc25\ud835\udc28\ud835\udc28\ud835\udc2b, \ud835\udc0e\ud835\udc1f\ud835\udc1f\ud835\udc22\ud835\udc1c\ud835\udc1e \ud835\udc13\ud835\udc28\ud835\udc30\ud835\udc1e\ud835\udc2b \ud835\udfcf, \ud835\udc13\ud835\udc22\ud835\udc26\ud835\udc1e\ud835\udc2c \ud835\udc02\ud835\udc22\ud835\udc2d\ud835\udc32, \ud835\udc0a\ud835\udc1a\ud835\udc26\ud835\udc1a\ud835\udc32\ud835\udc2e\ud835\udc2d \ud835\udc13\ud835\udc28\ud835\udc30\ud835\udc27\ud835\udc2c\ud835\udc21\ud835\udc22\ud835\udc29, \ud835\udc18\ud835\udc1a\ud835\udc27\ud835\udc20\ud835\udc28\ud835\udc27.</p><p data-block-key=\"3mts\">\ud835\udc47\u210e\ud835\udc52 \ud835\udc36\ud835\udc56\ud835\udc61\ud835\udc66''\ud835\udc60 \ud835\udc3b\ud835\udc52\ud835\udc4e\ud835\udc5f\ud835\udc61 \ud835\udc5c\ud835\udc53 \ud835\udc3f\ud835\udc52\ud835\udc4e\ud835\udc5f\ud835\udc5b\ud835\udc56\ud835\udc5b\ud835\udc54!</p><p data-block-key=\"m16q\">\ud835\udc36\ud835\udc56\ud835\udc61\ud835\udc66 \ud835\udc46\ud835\udc50\u210e\ud835\udc5c\ud835\udc5c\ud835\udc59 \ud835\udc4c\ud835\udc4e\ud835\udc5b\ud835\udc54\ud835\udc5c\ud835\udc5b</p>", "id": "a4e1ff19-9839-4dce-b73b-d3ae747fe346"}], "id": "05555f07-ac5c-41a7-bba4-0d5714a3c17b"}]');
INSERT INTO "blog_blogpage" VALUES (28,'2024-08-23','Cheers to our IGCSE Students! You made us proud!','[{"type": "base", "value": [{"type": "paragraph_block", "value": "<p data-block-key=\"7tsai\">We\u2019re thrilled to celebrate the amazing results our students have achieved in the \ud835\udc09\ud835\udc2e\ud835\udc27\ud835\udc1e \ud835\udfd0\ud835\udfce\ud835\udfd0\ud835\udfd2 \ud835\udc0f\ud835\udc1e\ud835\udc1a\ud835\udc2b\ud835\udc2c\ud835\udc28\ud835\udc27 \ud835\udc08\ud835\udc06\ud835\udc02\ud835\udc12\ud835\udc04 \ud835\udc1e\ud835\udc31\ud835\udc1a\ud835\udc26\ud835\udc2c! Their hard work and skill have truly made a mark. As some students continue their educational journey with programs like OSSD and NCUK at \ud835\udc00\ud835\udc1c\ud835\udc2e\ud835\udc26\ud835\udc1e\ud835\udc27 \ud835\udc08\ud835\udc27\ud835\udc2d\ud835\udc1e\ud835\udc2b\ud835\udc27\ud835\udc1a\ud835\udc2d\ud835\udc22\ud835\udc28\ud835\udc27\ud835\udc1a\ud835\udc25 \ud835\udc02\ud835\udc28\ud835\udc25\ud835\udc25\ud835\udc1e\ud835\udc20\ud835\udc1e, we are excited to see them continue to excel and reach new heights.</p><p data-block-key=\"dl3j7\">\ud835\udc09\ud835\udc2e\ud835\udc27\ud835\udc1e \ud835\udfd0\ud835\udfce\ud835\udfd0\ud835\udfd2 \ud835\udc0f\ud835\udc1e\ud835\udc1a\ud835\udc2b\ud835\udc2c\ud835\udc28\ud835\udc27 \ud835\udc08\ud835\udc06\ud835\udc02\ud835\udc12\ud835\udc04 \ud835\udc1e\ud835\udc31\ud835\udc1a\ud835\udc26\ud835\udc2c\u2019 \ud835\udc0e\ud835\udc2f\ud835\udc1e\ud835\udc2b\ud835\udc1a\ud835\udc25\ud835\udc25 \ud835\udc11\ud835\udc1e\ud835\udc2c\ud835\udc2e\ud835\udc25\ud835\udc2d\ud835\udc2c</p><p data-block-key=\"8eofq\">\ud835\udc00* - \ud835\udfd0\ud835\udfcf</p><p data-block-key=\"c4nvp\">\ud835\udc00 - \ud835\udfcf\ud835\udfd6</p><p data-block-key=\"e5fv9\">\ud835\udc01 - \ud835\udfd0\ud835\udfd3</p><p data-block-key=\"cbodu\">\ud835\udc13\ud835\udc21\ud835\udc1e \ud835\udc02\ud835\udc22\ud835\udc2d\ud835\udc32\u2019\ud835\udc2c \ud835\udc07\ud835\udc1e\ud835\udc1a\ud835\udc2b\ud835\udc2d \ud835\udc28\ud835\udc1f \ud835\udc0b\ud835\udc1e\ud835\udc1a\ud835\udc2b\ud835\udc27\ud835\udc22\ud835\udc27\ud835\udc20!<br/>\ud835\udc02\ud835\udc22\ud835\udc2d\ud835\udc32 \ud835\udc12\ud835\udc1c\ud835\udc21\ud835\udc28\ud835\udc28\ud835\udc25 \ud835\udc13\ud835\udc1a\ud835\udc2e\ud835\udc27\ud835\udc20\ud835\udc20\ud835\udc32\ud835\udc22</p>", "id": "43caa674-df7a-4757-8146-8c8ac59e45d0"}, {"type": "block_quote", "value": {"text": "\ud835\udc13\ud835\udc21\ud835\udc1e \ud835\udc02\ud835\udc22\ud835\udc2d\ud835\udc32\u2019\ud835\udc2c \ud835\udc07\ud835\udc1e\ud835\udc1a\ud835\udc2b\ud835\udc2d \ud835\udc28\ud835\udc1f \ud835\udc0b\ud835\udc1e\ud835\udc1a\ud835\udc2b\ud835\udc27\ud835\udc22\ud835\udc27\ud835\udc20!", "attribute_name": "\ud835\udc02\ud835\udc22\ud835\udc2d\ud835\udc32 \ud835\udc12\ud835\udc1c\ud835\udc21\ud835\udc28\ud835\udc28\ud835\udc25 \ud835\udc13\ud835\udc1a\ud835\udc2e\ud835\udc27\ud835\udc20\ud835\udc20\ud835\udc32\ud835\udc22"}, "id": "099574c2-a340-4d97-93a5-c03408ef7c70"}], "id": "6acf2324-7cbf-42db-be20-d44a4440c2e2"}]');
