INSERT INTO "home_homepage" VALUES (3,6,'Elevate your Children''s Education','Our Programs',11,'Send Us A Message',9,'Experience a vibrant educational environment that nurtures growth and excellence. Our IGCSE program offers a comprehensive curriculum designed to prepare students for success.','[{"type": "faqs", "value": {"title": "Frequently Asked Questions", "subtitle": "These are a few questions that we receive from our students and parents. We hope it helps what you need to know. If not, please do not hesitate to contact us.", "faqs": [{"type": "item", "value": {"question": "Why is this a question?", "answer": "<h2 data-block-key=\"5nyu8\">Heading 2</h2><p data-block-key=\"cg4ur\">These are a <b>few questions</b> that we receive from our students and parents. We hope it helps what you need to know. If not, please do not hesitate to contact us.</p><h2 data-block-key=\"ffe60\">Test Heading 2</h2><p data-block-key=\"604eb\"><a href=\"https://www.youtube.com\">Youtube</a></p><p data-block-key=\"css1t\"></p><embed embedtype=\"media\" url=\"https://www.youtube.com/watch?v=mF9yOwlunWk\"/><p data-block-key=\"ch63e\"></p><p data-block-key=\"3g81e\"></p><embed embedtype=\"image\" format=\"left\" id=\"89\" alt=\"1\"/><h3 data-block-key=\"eiopr\">Test Heading 3</h3><p data-block-key=\"3qvs8\">These are a <b><i>few questions</i></b> that we receive from our students and parents. We hope it helps what you need to know. If not, please do not hesitate to contact us.</p>"}, "id": "394f7984-e68a-42b2-9bcb-2e1d215e01cd"}, {"type": "item", "value": {"question": "Question Two", "answer": "<p data-block-key=\"b42qy\">Answer Two</p>"}, "id": "51b7b1f6-8dc3-4ab6-8b56-67d2db36093a"}, {"type": "item", "value": {"question": "Third Question", "answer": "<p data-block-key=\"qysdz\">Answer to the 3rd Question</p>"}, "id": "91313500-fcde-47a2-90fc-3d66a140a86d"}]}, "id": "84d80527-ca44-4d96-b6e8-5a4634d9523e"}]','Reasons To Choose Us','Points of Distinction','At our school, we believe that every student has the potential to excel. Our dedicated teachers and innovative teaching methods ensure that each student receives the individual attention they need to thrive. Join us and unlock your full potential today.','Comprehensive Educational Programs for All Ages','Unlock Your Potential','[{"type": "image_gallery", "value": {"title": "Our A-Star Students", "subtitle": "A huge congratulations to our incredible students who have achieved high distinctions in the recent IGCSE exams! Your hard work, dedication, and talent have truly paid off. We are so proud of your accomplishments.\ud83d\udc4f A special thanks to all the parents and teachers for their unwavering support and guidance. Your efforts have been instrumental in shaping these young minds.", "text_align": "text-start", "images": [{"type": "item", "value": {"image": 103, "caption": "Htet Htet Aung ( 6A*, 1A )"}, "id": "ed8df0ca-aae5-4754-a445-be3f5d37f348"}, {"type": "item", "value": {"image": 99, "caption": "Nang Kham Non"}, "id": "a6a5db0a-7fd9-4201-b5fc-159a168bebe8"}, {"type": "item", "value": {"image": 104, "caption": "Phyo Ei Mon"}, "id": "bf5fb843-3ff1-4e25-b3e7-4f9aee730fb7"}, {"type": "item", "value": {"image": 105, "caption": "Nang Eaint Myat Noe Nge"}, "id": "ef3a96b8-1567-4349-b04b-3fa058d46929"}, {"type": "item", "value": {"image": 100, "caption": "Sai Kaung Myat Yar Zar"}, "id": "e3b17461-5f88-4fde-b75b-43a845210a9d"}, {"type": "item", "value": {"image": 102, "caption": "Nang Ying Lao Hseng, Nang San Mwam"}, "id": "3321ef58-a44e-4d75-bc81-c538143d697e"}, {"type": "item", "value": {"image": 101, "caption": "Eaint Kyar Phyu, Nang Ngin Saing Saing"}, "id": "8f074603-e45a-4bb3-9f0a-4a8c43c9eaed"}, {"type": "item", "value": {"image": 106, "caption": "Sai Tun Lin Aung, Phyo Naing Kham"}, "id": "65a1ecbc-4bf2-499f-a5af-f0b3701c6ce4"}]}, "id": "91eb86c5-b04b-46a1-b6e5-dc14e7980b2a"}]');
INSERT INTO "home_homepagefeatures" VALUES (1,3,'Tailored Support','Dedicated professional care and support teams are always available for help and advice.',40,3);
INSERT INTO "home_homepagefeatures" VALUES (2,0,'Medium Sized Classroom','We have 15-20 students per class on the IGCSE Program, meaning 1v1 interactions with your teachers.',37,3);
INSERT INTO "home_homepagefeatures" VALUES (3,1,'Experienced Teachers','All our teachers are subject specialists. They have passion in their respective fields',38,3);
INSERT INTO "home_homepagefeatures" VALUES (4,2,'Flexible Programs','We have different available course durations  depending on student needs',39,3);
INSERT INTO "home_homepagelocation" VALUES (1,0,'Yangon','The city''s heart of learning','Located in the heart of the amazing city of Yangon.Students can enjoy the city life experience in our school.','7th Floor, Office Tower 1, Times City, Kamayut, Yangon','info@cityschoolmm.com',75,3,76,'[{"type": "phone", "value": "+95 9 786 029 585", "id": "0d832f98-b332-4e71-a114-406da076f333"}, {"type": "phone", "value": "+95 9 786 029 586", "id": "18fa12e0-a5c7-4dc1-946a-6ecdd9b5bce4"}]');
INSERT INTO "home_homepagelocation" VALUES (2,1,'Taunggyi','Achieve New Heights','Nestled among the serene peaks of Taunggyi, our school in the mountains inspires learning at new heights','No. 72/9 Kanbawza Street, Taunggyi, Myanmar','info@cityschoolmm.com',79,3,2,'[{"type": "phone", "value": "+95 9 786 029 589", "id": "d0f281f9-32c3-438b-a22c-ec33b1334526"}, {"type": "phone", "value": "+95 9 786 029 588", "id": "3bee8e39-3b67-4a89-9360-fb0a103b1083"}]');
