INSERT INTO "home_homepageprograms" VALUES (1,0,'Pre-School','Ages 3 - 5','In our preschool haven, little ones embark on a magical journey of discovery and gentle guidance that cultivates a joyous introduction to the wonders of early education.',3,68);
INSERT INTO "home_homepageprograms" VALUES (2,1,'Primary','Age 5 - 11','At our primary program, young minds bloom with curiosity and thrive in an engaging environment, laying the foundation for a lifelong learning.',3,69);
INSERT INTO "home_homepageprograms" VALUES (3,2,'Secondary','Ages 11 - 14','At our secondary level, students embark on an enriching educational voyage, where rigorous academics meet personal growth, fostering critical thinking and collaboration.',3,70);
INSERT INTO "home_homepageprograms" VALUES (4,3,'IGCSE','Ages 14 - 16','Our IGCSE program offers a comprehensive curriculum that prepares students for the challenges of higher education.',3,71);
