INSERT INTO "wagtailcore_revision" VALUES (183,'2024-07-21 20:12:34.731000',NULL,1,'{"pk": 19, "path": "000100010006", "depth": 3, "numchild": 0, "translation_key": "c5d1e423-1909-40d4-bf25-8b401e7eb0ef", "locale": 1, "latest_revision": 169, "live": true, "has_unpublished_changes": false, "first_published_at": "2024-06-28T06:17:50.223Z", "last_published_at": "2024-07-14T21:55:14.506Z", "live_revision": 169, "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "locked_at": null, "locked_by": null, "title": "About Us", "draft_title": "About Us", "slug": "aboutus", "content_type": 58, "url_path": "/home/aboutus/", "owner": 1, "seo_title": "", "show_in_menus": false, "search_description": "", "latest_revision_created_at": "2024-07-14T21:55:14.465Z", "alias_of": null, "header_title": "About Us", "header_subtitle": "We started with a dream that all children deserves quality education in a fun community that nurture", "header_image": "DSC07289.webp", "mission_header": "Mission Statement", "mission_statement": "[{\"type\": \"paragraph_block\", \"value\": \"<p data-block-key=\\\"dr3k3\\\">Our mission is to provide a world-class education to our students through the International General Certificate of Secondary Education (IGCSE) curriculum. We believe in inspiring and empowering our students to become lifelong learners and global citizens who are confident, independent, and responsible.</p>\", \"id\": \"f37a7244-8440-47e4-a9fe-d63c15d4a148\"}, {\"type\": \"paragraph_block\", \"value\": \"<ul><li data-block-key=\\\"1h9jn\\\">Foster a love of learning in every student through a challenging, engaging, and well-rounded academic program.</li></ul><p data-block-key=\\\"cellq\\\"></p><ul><li data-block-key=\\\"5qdbr\\\">Foster a culture of collaboration, communication, and creativity, both within the school and within the wider community.</li></ul><p data-block-key=\\\"erboe\\\"></p><ul><li data-block-key=\\\"3pv3q\\\">Provide a safe, welcoming, and inclusive environment for all students, regardless of their background or ability.</li></ul><p data-block-key=\\\"du47p\\\"></p><ul><li data-block-key=\\\"a2rdq\\\">Foster a culture of collaboration, communication, and creativity, both within the school and within the wider community.</li></ul>\", \"id\": \"dc1d84a2-ba7e-4129-8c17-4201a145ccc5\"}]", "founder_section_title": "Our Founder", "founder_name": "San Zaw Htet", "founder_title": "B.Sc (Hons) Information Technology Management in Business", "founder_description": "San is a seasoned leader and cultivated education counsellor. He is a proud graduate of Northumbria University with a degree in Information Technology Management.\r\n\r\nPrior to launching City School in Taunggyi, he founded Acumen International College and Intel-Bridge Education Consultancy in Yangon. He is passionate about delivering quality education to students as well as providing them with pathways towards their dream careers.", "founder_image": 36, "staff_cards": "[{\"type\": \"cards\", \"value\": {\"title\": \"Meet our Faculty\", \"subtitle\": \"Our faculty and staff are the most hardworking and certified individuals. Together we come to provide the best educational services in the country.\", \"cards\": [{\"type\": \"item\", \"value\": {\"image\": 71, \"name\": \"Student 1\", \"subtitle\": \"Students 2\"}, \"id\": \"efa7127d-a81a-49c8-a03f-5145a435f384\"}]}, \"id\": \"464385b7-69df-43b0-8f25-2f62d5807798\"}, {\"type\": \"cards\", \"value\": {\"title\": \"Meet Our Teachers\", \"subtitle\": \"Our faculty and staff are the most hardworking and certified individuals. Together we come to provide the best educational services in the country.\", \"cards\": [{\"type\": \"item\", \"value\": {\"image\": 32, \"name\": \"Seamus O Corragain\", \"subtitle\": \"Secondary Teacher\"}, \"id\": \"fe83a989-0a3e-439c-bfd7-fa0437032976\"}, {\"type\": \"item\", \"value\": {\"image\": 34, \"name\": \"Janfaye Capinpin\", \"subtitle\": \"Primary Homeroom Teacher\"}, \"id\": \"27b26713-b92c-4f10-860d-432dec1a6028\"}, {\"type\": \"item\", \"value\": {\"image\": 33, \"name\": \"Gerald Capinpin\", \"subtitle\": \"Secondary Teacher\"}, \"id\": \"284d13be-fa15-4270-9d53-e9a29f2bfc81\"}, {\"type\": \"item\", \"value\": {\"image\": 34, \"name\": \"Janfaye Two\", \"subtitle\": \"Secondary Teacher\"}, \"id\": \"9def3081-e72e-47e2-9492-de70b359c276\"}]}, \"id\": \"a990d9b9-9b2d-4698-b026-9fbf381443dc\"}]", "gallery_heading": "Our School, Our Team, Our Triumph!", "gallery_subheading": "Led by visionary administrators, our faculty works collaboratively to create a positive and inclusive environment that nurtures the academic and personal growth of every student.", "wagtail_admin_comments": [], "gallery_images": [{"pk": 1, "sort_order": 0, "page": 19, "image": 80, "caption": "Staff Conference"}, {"pk": 2, "sort_order": 1, "page": 19, "image": 81, "caption": "Faculty Party"}, {"pk": 3, "sort_order": 2, "page": 19, "image": 82, "caption": "Thadinkyut Party"}, {"pk": 4, "sort_order": 3, "page": 19, "image": 82, "caption": "Thadinkyut Party"}]}','19',58,1,'About Us');
