INSERT INTO "wagtailcore_revision" VALUES (244,'2024-07-30 17:28:45.479000',NULL,1,'{"pk": 21, "path": "000100010007", "depth": 3, "numchild": 0, "translation_key": "0aaf9f5d-6a02-4d9a-b54b-5f8a4ac7450a", "locale": 1, "latest_revision": 182, "live": true, "has_unpublished_changes": false, "first_published_at": "2024-07-18T06:25:21.887Z", "last_published_at": "2024-07-20T23:19:49.180Z", "live_revision": 182, "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "locked_at": null, "locked_by": null, "title": "Contact Us Form", "draft_title": "Contact Us Form", "slug": "contact-us-form", "content_type": 57, "url_path": "/home/contact-us-form/", "owner": 1, "seo_title": "Contact Us", "show_in_menus": false, "search_description": "", "latest_revision_created_at": "2024-07-20T23:19:49.143Z", "alias_of": null, "to_address": "", "from_address": "saiherng14@gmail.com", "subject": "Contact Us Inquiries", "intro": "<h2 data-block-key=\"ztqti\">Please send us your inquiries and we will respond shortly.</h2><p data-block-key=\"fjrod\"> <b>Teacher duties and responsibilities</b></p><p data-block-key=\"d85oo\">The duties and responsibilities of Teachers vary depending on the age and abilities of their students. Primary School Teachers typically have a heavier focus on social and formative skills, while Secondary and Postsecondary School Teachers focus on selecting and developing skills for specific career paths. Examples of their common duties and responsibilities include:</p><ul><li data-block-key=\"c6sa1\">Establishing and enforcing rules of behavior for students in the classroom</li><li data-block-key=\"7epf2\">Preparing lessons, units and projects to complete learning objectives</li><li data-block-key=\"rd9r\">Establishing and communicating clear objectives for lessons, units and projects</li><li data-block-key=\"aanm7\">Adapting teaching methods and materials to meet the interests and learning styles of students</li><li data-block-key=\"50kll\">Encouraging students to explore learning opportunities and career paths</li><li data-block-key=\"4h1qn\">Creating, assigning and grading various assessments for students, including tests, quizzes, essays and projects</li><li data-block-key=\"266tq\">Working with students one-on-one when they need extra help or attention</li><li data-block-key=\"7phcm\">Tracking and evaluating student academic progress</li><li data-block-key=\"fld41\">Leading parent-teacher meetings</li><li data-block-key=\"eokcg\">Maintaining positive relationships with students, parents, coworkers and supervisors</li><li data-block-key=\"bmomr\">Managing student behavior</li><li data-block-key=\"6elbg\">Creating a safe, respectful and inclusive classroom environment</li><li data-block-key=\"94e9k\">Communicating regularly with parents</li><li data-block-key=\"bq6p2\">Helping students improve study methods and habits</li><li data-block-key=\"28r74\">Administering tests to evaluate students\u2019 progress</li></ul>", "body": "[]", "thank_you_text": "<p data-block-key=\"u1icm\">Thank you for sending us your queries. We will respond shortly</p>", "wagtail_admin_comments": [], "form_fields": [{"pk": 5, "sort_order": 0, "clean_name": "name", "label": "Name", "field_type": "singleline", "required": true, "choices": "", "default_value": "", "help_text": "", "page": 21}, {"pk": 6, "sort_order": 1, "clean_name": "course_of_study", "label": "Course of Study", "field_type": "singleline", "required": true, "choices": "", "default_value": "", "help_text": "", "page": 21}, {"pk": 7, "sort_order": 2, "clean_name": "email", "label": "Email", "field_type": "email", "required": true, "choices": "", "default_value": "", "help_text": "Enter Your Email", "page": 21}, {"pk": 8, "sort_order": 3, "clean_name": "phone", "label": "Phone", "field_type": "singleline", "required": true, "choices": "", "default_value": "", "help_text": "Enter Your Phone", "page": 21}, {"pk": 9, "sort_order": 4, "clean_name": "message", "label": "Message", 